import React from 'react';
import css from './Button.module.css';

const Button = props => {
    let disabledButton = props.access === false? ``: ``;
    return (
        <>
            <button className={css.buttons}
                    onClick={() => props.onClickButton()} disabled={`disabled`}>
                {props.buttonsTitle}
            </button>
        </>
    );
};

export default Button;
